tables.table_schema:
CREATE TABLE customer_survey_data (
  customer_id INT PRIMARY KEY,
  survey_id INT,
  satisfaction_score INT,
  feedback TEXT
);

CREATE TABLE predictive_analytics_models (
  model_id INT PRIMARY KEY,
  model_name TEXT,
  prediction_date DATE,
  satisfaction_level INT
);

CREATE TABLE PredictiveModels (
    model_id INT PRIMARY KEY,
    model_name VARCHAR(50),
    description TEXT,
    create_date DATE
);

CREATE TABLE SatisfactionForecast (
    forecast_id INT PRIMARY KEY,
    customer_id INT,
    forecast_date DATE,
    predicted_satisfaction INT
);

CREATE TABLE customer_data (
  customer_id INT,
  survey_date DATE,
  satisfaction_score INT
);

CREATE TABLE customer_demographics (
  customer_id INT,
  age INT,
  gender VARCHAR(10),
  location VARCHAR(50)
);

CREATE TABLE survey_questions (
  question_id INT,
  question_text VARCHAR(255)
);

CREATE TABLE survey_responses (
  response_id INT,
  customer_id INT,
  question_id INT,
  response_text TEXT
);

CREATE TABLE predictive_models (
  model_id INT,
  model_name VARCHAR(50),
  accuracy_score FLOAT,
  last_updated TIMESTAMP
);
